const MenuBlock = React.forwardRef(({ index, title, href }, ref) => {
  return (
    <a href={href} ref={ref} className={index}>
      <div className="block-option">
        <div id={title} className={index}>
          <h2 className={index}>{title}</h2>
        </div>
      </div>
    </a>
  );
});

export default MenuBlock;
